import { useState } from "react"
import axios from "axios"
import { useNavigate } from "react-router-dom"
export default function Login() {
    const nav = useNavigate()
    const [form,setForm] = useState({})
    function onChange(event){
        if (event.target.name === "username" ){
            setForm(prev => {return {...prev , username : event.target.value}})
        }
        if (event.target.name === "pass" ){
            setForm(prev => {return {...prev , password : event.target.value}})
        }
    }
    function Login(e){
        e.preventDefault()
        axios.defaults.xsrfCookieName = 'csrftoken'
        axios.defaults.xsrfHeaderName = "X-CSRFTOKEN"
        axios.post("api/login/", JSON.stringify(form), {
            "headers": {
                'Content-Type': 'application/json',
            }
        }).then(response => nav(`/profile/${response.data.id}`,state={"pk" : response.data.id}))
        .catch(err => console.log(err))
        console.log(form)
    }
    return (
        <div className="formbox">
            <form onSubmit={Login} method="post">
                <div>
                    <label htmlFor="username" >Username :</label>
                    <input onChange={onChange} type={"text"} name="username" />
                </div>
                <div>
                    <label htmlFor="pass" >Password :</label>
                    <input onChange={onChange} type={"text"} name="pass" />
                </div>
                <div>
                    <button  type="submit" >Login</button>
                </div>
            </form>
        </div>
    )
}
